script: |
  super -f tsv -I q196.sql | sort > q196.out

vector: true

inputs:
  - name: q196.sql
    data: |
      SELECT - + ( - col2 ) / + CAST ( - - col0 AS INTEGER ) FROM tab0 AS cor0 WHERE NOT ( col0 NOT BETWEEN col2 - + + 83 AND col2 + 65 );
  - name: tab0

outputs:
  - name: q196.out
    data: |
      1
      3
